import Layout from "./layout"

export default class Library extends Component {
  show() {
    const books = ["whale", "alice"]

    return (
      <Layout>
        <library>
          {books.map(book => (
            <a href={`?book=${book}`}>{book}</a>
          ))}
        </library>
      </Layout>
    )
  }
}
